import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate the first product's "Add to Cart" button using a robust, user-facing locator
    const firstProductAddToCartButton = page.locator('.product-card').first().getByRole('button', { name: 'Add to Cart' });

    // Wait for the button to be visible, ensuring JS has rendered the products
    await firstProductAddToCartButton.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot before clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_add_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_add_to_cart.png'));

    // Click the "Add to Cart" button
    await firstProductAddToCartButton.click();

    // Take a screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_add_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_add_to_cart.png'));

    // Verify the action by checking localStorage, as the UI counter might not update reliably
    const cartData = await page.evaluate(() => {
      return JSON.parse(localStorage.getItem('amazonCart'));
    });

    if (!cartData || cartData.length === 0) {
      throw new Error('Cart data not found in localStorage after clicking "Add to Cart".');
    }

    return {
      success: true,
      action: "Added the first product to the cart.",
      extractedData: {
        cartItemCount: cartData.length,
        firstItemTitle: cartData[0].title,
        firstItemPrice: cartData[0].price,
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add the first product to the cart.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
